geregisseerd door Dave Schram
met Ko Zandvliet, Abbey Hoes en Sander de Heer

Sven (15) wil regisseur worden en is al volop bezig met filmen. Hij filmt vooral zijn vrienden die aan free running doen en zet de filmpjes dan op YouTube. Hij vraagt Roosmarijn om mee te werken aan zijn eerste speelfilm. Zij mag echter niet te weten komen dat hij thuis regelmatig een pak rammel krijgt. Het lukt hem zijn blauwe plekken voor iedereen verborgen te houden totdat hij er op een dag zo slecht aan toe is dat hij bij zijn oma onderduikt. Daardoor mist hij zijn verjaardag. Roosmarijn denkt dat hij haar niet meer leuk vindt en ook zijn vrienden zijn boos op hem. Hij besluit om voor eens en voor altijd met zijn vader af te rekenen, totdat hij ontdekt waarom zijn vader hem slaat.



